import { memo, useEffect, useRef, useState } from "react";
import { useGlobalContext } from "../utils/GlobalProvider";
import { NavLink } from "react-router-dom";
import { ROUTES } from "../utils/Routes";

import "swiper/css";
import { Swiper, SwiperSlide } from "swiper/react";

import { CiSquarePlus } from "react-icons/ci";

function PageCategories() {
	const swiperRef = useRef(null);
	const { user, getCategories } = useGlobalContext();
	const [categories, setCategories] = useState(null);

	const style = {
		backgroundImage:
			"url(https://images.unsplash.com/photo-1501167786227-4cba60f6d58f?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1770&q=80)",
	};

	useEffect(() => {
		async function listCategories() {
			const cats = await getCategories();
			setCategories(async () => await getCategories());
			console.log(categories);
		}

		listCategories();
	}, []);

	return (
		<div className="page categories">
			<section>
				<div className="hero" style={style}>
					<div className="hero-content">
						<h1>My categories</h1>
					</div>
					<div className="overlay"></div>
				</div>
			</section>
			<section className="slider">
				<Swiper
					ref={swiperRef}
					slidesPerView={"auto"}
					spaceBetween={20}
					slidesOffsetAfter={75}
				>
					<SwiperSlide>
						<NavLink to={ROUTES.ADDCATEGORIE}>
							<div className="swiper-card">
								<div className="swiper-card-content">
									<CiSquarePlus size={40} />
									<p>Add a categorie</p>
								</div>
							</div>
						</NavLink>
					</SwiperSlide>{" "}
					<SwiperSlide>
						<div className="swiper-card">
							<div className="swiper-card-content">
								<CiSquarePlus size={40} />
								<p>Add categorie</p>
							</div>
						</div>
					</SwiperSlide>{" "}
					<SwiperSlide>
						<div className="swiper-card">
							<div className="swiper-card-content">
								<CiSquarePlus size={40} />
								<p>Add categorie</p>
							</div>
						</div>
					</SwiperSlide>{" "}
					<SwiperSlide>
						<div className="swiper-card">
							<div className="swiper-card-content">
								<CiSquarePlus size={40} />
								<p>Add categorie</p>
							</div>
						</div>
					</SwiperSlide>{" "}
					<SwiperSlide>
						<div className="swiper-card">
							<div className="swiper-card-content">
								<CiSquarePlus size={40} />
								<p>Add categorie</p>
							</div>
						</div>
					</SwiperSlide>
				</Swiper>
			</section>
		</div>
	);
}

export default memo(PageCategories);
